// SPDX-License-Identifier: MIT
pragma solidity ^0.8.1;

import "../node_modules/@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "../node_modules/@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "../node_modules/@openzeppelin/contracts/access/Ownable.sol";
import "../node_modules/@openzeppelin/contracts/utils/Counters.sol";
import "./LTToken.sol";


contract Marketplace is Ownable {
    using Counters for Counters.Counter;
    Counters.Counter private _Ids;
    address payable public marketAddress;

    struct TokenInfo {
        uint256 id;
        address payable seller;
        address NFTaddress;
        uint256 tokenId;
        uint256 price;
        bool sold;
        uint256 creatorFee;
    }

    mapping(uint256 => TokenInfo) public TokenOnSale;

    event Add(uint256 id, address indexed NftAddress, address indexed seller, uint256 tokenId, uint256 price, uint256 creatorFee);
    event Buy(uint256 id, address indexed NftAddress, address indexed seller, address indexed buyer, uint256 tokenId, uint256 price);

    constructor() {
        marketAddress = payable(msg.sender);
    }

    function addNftToMarket(address _NFTaddress, uint256 _tokenId, uint256 _price, uint256 _creatorFee) external {
        require(IERC721(_NFTaddress).ownerOf(_tokenId) == msg.sender, "You are not the owner of this NFT");


        for (uint i = 1; i <= _Ids.current(); i++) {
            require(!(TokenOnSale[i].NFTaddress == _NFTaddress && TokenOnSale[i].tokenId == _tokenId), "This NFT is already added to Market");
        }

        _Ids.increment();
        TokenOnSale[_Ids.current()] = TokenInfo(_Ids.current(), payable(msg.sender), _NFTaddress, _tokenId, _price, false, _creatorFee);

        emit Add(_Ids.current(), _NFTaddress, msg.sender, _tokenId, _price, _creatorFee);
    }


    function getAllNftsOnSale() external view returns (TokenInfo[] memory) {
        uint count;
        TokenInfo[] memory checkList = new TokenInfo[](_Ids.current());
        for (uint i = 1; i <= _Ids.current(); i++) {
            if (!TokenOnSale[i].sold) {
                checkList[count] = TokenOnSale[i];
                count++;
            }
        }
        TokenInfo[] memory filteredCheckList = new TokenInfo[](count);
        for (uint i = 0; i < count; i++) {
            filteredCheckList[i] = checkList[i];
        }
        return filteredCheckList;
    }

    function buyNfts(uint256[] calldata _ids) external payable {
        require(msg.value > 0, "No ETH sent");

        for (uint256 i = 0; i < _ids.length; i++) {
            buyNft(_ids[i]);
        }
    }

    function buyNft(uint256 _id) public payable {
        require(msg.value >= TokenOnSale[_id].price * (10 ** 18), "Not enough ETH");
        require(!TokenOnSale[_id].sold, "Already soldout");
        require(msg.sender != TokenOnSale[_id].seller, "You can't buy your NFT");

        uint256 price = TokenOnSale[_id].price * (10 ** 18);
        uint256 marketFee = price * 1 / 100; // 1%
        uint256 creatorFee = 0;
        uint256 sellerAmount = price - marketFee - creatorFee;

        marketAddress.transfer(marketFee);

        address payable creator = MyNFT(TokenOnSale[_id].NFTaddress).getCreator();
        if (TokenOnSale[_id].seller != creator) {
            creatorFee = price * TokenOnSale[_id].creatorFee / 1000; // 0, 2.5, 5
            creator.transfer(creatorFee);
        }

        payable(TokenOnSale[_id].seller).transfer(sellerAmount); // Transfer the funds to the seller's address
        TokenOnSale[_id].sold = true;
        TokenOnSale[_id].seller = payable(msg.sender);

        emit Buy(_id, TokenOnSale[_id].NFTaddress, TokenOnSale[_id].seller, msg.sender, TokenOnSale[_id].tokenId, TokenOnSale[_id].price);
    }


    // function reApprove(uint256 _id) public {
    //     require(msg.sender == TokenOnSale[_id].seller, "You are not the owner of this NFT");
    //     // IERC721(TokenOnSale[_id].NFTaddress).approve(address(this), _id);
    //     IERC721(TokenOnSale[_id].NFTaddress).setApprovalForAll(address(this), true);
    // }

    function reAddNftToMarket(uint256 _id, uint256 _price) external {
        require(TokenOnSale[_id].sold, "This NFT is not sold");
        require(msg.sender == TokenOnSale[_id].seller, "You are not the owner of this NFT");

        TokenOnSale[_id].price = _price;
        TokenOnSale[_id].sold = false;

        emit Add(_id, TokenOnSale[_id].NFTaddress, msg.sender, TokenOnSale[_id].tokenId, _price, TokenOnSale[_id].creatorFee);
    }
}
